import React from 'react'

const Collaborate = () => {
    return(
        <>
            <div className="collaborate_main">
                <img src="/img/collaborate_main_title.png" alt=""/>
                <img src="/img/renew.png" alt=""/>
            </div>
        </>
    );
};

export default Collaborate;
